import React from "react";
import lynxHareData from "../data/lynx_hare.json";

export default function Dashboard() {
    return (
        <section>
            <h1>Lynx–Hare Dataset (1845–1935)</h1>

            <p className="mt-3">Preview of the first 5 rows:</p>

            <pre className="bg-light p-3 rounded">
                {JSON.stringify(lynxHareData.slice(0, 5), null, 2)}
            </pre>
        </section>
    );
}
